import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TableContainer, Table, TableHeader, TableCell, TableRow, TableBody ,PageTitle} from '@windmill/react-ui';

const SingleOrder = ({ match }) => {
  const [order, setOrder] = useState(null);
  const orderId = match.params.id; // Get the orderId from the route parameter
  const token = localStorage.getItem('accessToken')

  useEffect(() => {
    const fetchOrder = async () => {

        try {
            const config = {
              headers: {
                Authorization: `Bearer ${token}`,
              },
            };
        const response = await axios.get(`http://localhost:8080/api/orders/${orderId}`,config);
        setOrder(response.data);
      } catch (error) {
        console.error('Error fetching order:', error);
      }
    };

    fetchOrder();
  }, [orderId]);

  if (!order) {
    return <div>Loading...</div>;
  }

  return (
    console.log(order),
    <div>
        <PageTitle>Статус на поръчката : {order.status}</PageTitle>
      <h1>Материал : {order.groups[0].door.name}</h1>
      <TableContainer>
        <Table>
          <TableHeader>
            <tr>
    <TableCell>Модел</TableCell>
    <TableCell>Фолио</TableCell>
    <TableCell>Профил</TableCell>
    <TableCell>Дръжка</TableCell>
    <TableCell>Височина,мм</TableCell>
    <TableCell>Широчина, мм</TableCell>
    <TableCell>Брой</TableCell>
    <TableCell>Цена Дръжка, бр.</TableCell>
    <TableCell>Цена мат за кв.м</TableCell>
    <TableCell>Двустр. ламиниране</TableCell>
    <TableCell>Стойност</TableCell>

              {/* Add more table headers for other fields */}
            </tr>
          </TableHeader>
          <TableBody>
            <TableRow>
              <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.model.name}
        </div>
      ))}</TableCell>
              <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.folio.name}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.profil.name}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.handle.name}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.height}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.width}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.number}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.handle.price}
        </div>
      ))}</TableCell>
      <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.matPrice}
        </div>
      ))}</TableCell>
       <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.isBothSidesLaminated}
        </div>
      ))}</TableCell>
       <TableCell>{order.groups.map((group, j) => (
        <div key={j}>
          {group.groupTotalPrice}лв.
        </div>
      ))}</TableCell>

              {/* Add more table cells for other fields */}
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default SingleOrder;
